namespace playground.UnitTest;

public class BeautifulSubstringsTest_2949
{
    [Theory]
    [InlineData("baeyh", 2, 2)]
    [InlineData("abba", 1, 3)]
    [InlineData("bcdf", 1, 0)]
    [MemberData(nameof(GetData))]
    public void BeautifulSubstrings(string s, int k, long expected)
    {
        var actual = BeautifulSubstrings_2949.BeautifulSubstrings(s, k);
        Assert.Equal(expected, actual);
    }

    public static IEnumerable<object[]> GetData()
    {
        yield return new object[]{
"",
1000,
0
        };
    }
}
